import {
  Routes,
  Route
} from "react-router-dom" 

import './App.css';
import Header from './components/Header'
import NotesListPage from './pages/NotesListPage';

function App() {
  return (
    <Routes>

      <Header/>
      <Route path='/' exact component={NotesListPage} />


    </Routes>
  );
}

export default App;
